  (promise, func) => promise.then(result => func(props).then(Array.prototype.concat.bind(result))),
  Promise.resolve([]),
);

export function verifyRouterData(arr) {
  // const obj = { ...arr.filter(e => e) };
  const obj = { ...arr };
  let result = {};
  // Foreach to verify data before merge to object result
  Object.keys(obj).forEach((o) => {
    if (typeof obj[o] === 'object') {
      result = Object.assign({}, result, obj[o]);
    }
  });

  return result;
}

export function rejectErrorObject(obj) {
  const error = new Error();
  error.message = obj;
  return error;
}

export function makeCancelable(promise) {
  let hasCanceled = false;

  const wrappedPromise = new Promise((resolve, reject) => {
    promise
      .then(val => (
        hasCanceled
          ? reject(rejectErrorObject({ isCanceled: true }))
          : resolve(val)
      ))
      .catch(error => (
        hasCanceled
          ? reject(rejectErrorObject({ isCanceled: true }))
          : reject(error)
      ));
  });

  return {
    promise: wrappedPromise,
    cancel() {
      hasCanceled = true;
    },
  };
}

export function checkReplaceUrlMatch(redirect, match) {
  let redirectUrl = redirect;

  // Check route has match params if has then replace redirect url with dynamic params
  if (match && match.params) {
    Object.keys(match.params).forEach((key) => {
      const regex = new RegExp(`:${key}`, 'g');
      redirectUrl = redirectUrl.replace(regex, match.params[key]);
    });
  }

  return redirectUrl;
}
import React from 'react';
import { History } from 'history';
import Loading from '@/components/Loading';
import { promiseSerial, verifyRouterData, makeCancelable } from '@/utils/helpers';

interface Props {
  promise: () => void | Array<Promise<Function>>;
  children: React.ReactNode;
  history: History;
  guardData?: object;
}

type State = {
  data: object;
  resolvedSuccess: boolean;
}

class AsyncComponent extends React.Component<Props, State> {
  chains;

  static defaultProps = {
    guardData: {},
  };

  constructor(props) {
    super(props);
    this.state = {
      data: {},
      resolvedSuccess: false,
    };
  }

  componentDidMount() {
    const { promise, history } = this.props;
    const chainsFactory = promise.length ? promiseSerial(promise, this.props) : promise();

    this.chains = makeCancelable(chainsFactory);
    this.chains.promise
      .then((data) => {
        this.setState({
          data: verifyRouterData(data),
          resolvedSuccess: true,
        });
      })
      .catch((error) => {
        if (
          error
          && error.message
          && ((typeof error.message === 'object' && !error.message.isCanceled)
          || (typeof error.message === 'string' && error.message.indexOf('/') > -1))
        ) {
          history.push(error.message);
        }
      });
  }

  componentWillUnmount() {
    this.chains.cancel();
  }

  renderChildren() {
    const { children, guardData } = this.props;
    const { data } = this.state;

    return React.Children.map(children, (child: React.ReactElement) => (
      React.cloneElement(child, { guardData: { ...guardData, ...data } })
    ));
  }

  render() {
    const { resolvedSuccess } = this.state;
    if (resolvedSuccess) {
      return this.renderChildren();
    }

    return (<Loading />);
  }
}

export default AsyncComponent;
import React from 'react';
import { Route } from 'react-router-dom';

import AsyncComponent from '@/components/AsyncComponent';

export type Props = {
  path: string;
  render: (props) => void;
  canActivate?: Array<Promise<Function>>;
  exact?: boolean;
  strict?: boolean;
  guardData: object;
};

function Component(args: Props) {
  const { render, ...props } = args;

  return (
    <>
      {render(props)}
    </>
  );
}

class RouteGuard extends React.Component<Props> {
  static defaultProps: {
    canActivate: [],
    exact: false;
    strict: false,
  };

  renderAsync(props) {
    const { render, canActivate } = this.props;

    return (
      <AsyncComponent {...props} promise={canActivate}>
        <Component
          {...props}
          render={render}
        />
      </AsyncComponent>
    );
  }

  renderChildren = (props) => {
    const { render, canActivate, guardData } = this.props;
    const newProps = { ...props, guardData };

    if (canActivate && canActivate.length > 0) {
      return this.renderAsync(newProps);
    }

    return (
      <>
        {render(newProps)}
      </>
    );
  };

  render() {
    const { path, exact, strict } = this.props;

    return (
      <Route
        path={path}
        exact={exact}
        strict={strict}
        render={this.renderChildren}
      />
    );
  }
}

export default RouteGuard;
import React from 'react';
import { Route, Redirect } from 'react-router-dom';
import PropTypes from 'prop-types';

import { checkReplaceUrlMatch } from '@/utils/helpers';

const propTypes = {
  path: PropTypes.oneOfType([
    PropTypes.string,
    PropTypes.arrayOf(PropTypes.string),
  ]).isRequired,
  redirect: PropTypes.string.isRequired,
  exact: PropTypes.bool,
  strict: PropTypes.bool,
};

const defaultProps = {
  exact: true,
  strict: false,
};

function RouteRedirect(props) {
  const { path, exact, strict, redirect } = props;
  return (
    <Route
      path={path}
      exact={exact}
      strict={strict}
      render={props => (
        <Redirect
          from={path}
          to={{
            ...props.location,
            pathname: checkReplaceUrlMatch(redirect, props.match),
          }}
          exact={exact}
          strict={strict}
        />
      )}
    />
  );
}

RouteRedirect.propTypes = propTypes;
RouteRedirect.defaultProps = defaultProps;

export default RouteRedirect;
import React from 'react';
import { Switch } from 'react-router-dom';

import RouteGuard from '@/components/RouteGuard';
import RouteRedirect from '@/components/RouteRedirect';

function Routes(routes, extraProps = {guardData: Object}, switchProps = {}) {
  if (routes) {
    return (
      <Switch {...switchProps}>
        {routes.map((route, i) => {
          if (route.redirect) {
            return (
              <RouteRedirect
                key={route.key || i}
                path={route.path}
                exact={route.exact}
                strict={route.strict}
                redirect={route.redirect}
              />
            );
          }

          return (
            <RouteGuard
              key={route.key || i}
              path={route.path}
              exact={route.exact}
              strict={route.strict}
              canActivate={route.canActivate}
              guardData={extraProps.guardData}
              render={(props) => {
                const childRoutes = Routes(
                  route.routes,
                  { guardData: props.guardData } /* extraProps */,
                  {
                    /* switchProps */
                    location: props.location,
                  },
                );
                if (route.component) {
                  return (
                    <route.component {...props} route={route}>
                      {childRoutes}
                    </route.component>
                  );
                }

                return childRoutes;
              }}
            />
          );
        })}
      </Switch>
    );
  }

  return null;
}

export default Routes;
import React from 'react';
import { Router } from 'react-router-dom';

import { IConfig } from '@/models';
import Routes from '@/components/Routes';
import browserHistory from '@/utils/browserHistory';
import DataContext from '@/context/DataContext';

const defaultProps = {
  loading: true,
  history: null,
};

type Props = {
  config: IConfig;
  history?: null | Object;
  loading?: boolean | React.ReactElement;
} & typeof defaultProps;

function RouterGuard(props: Props) {
  const { config, loading, history } = props;

  return (
    <Router
      history={history || browserHistory}
    >
      <DataContext.Provider value={{ loading }}>
        {Routes(config)}
      </DataContext.Provider>
    </Router>
  );
}

RouterGuard.defaultProps = defaultProps;

export default RouterGuard;
